def Login():
    driver.get(loginURL)
    username = driver.find_element_by_id("ls_username")
    password = driver.find_element_by_id("ls_password")

    username.send_keys(UID)
    password.send_keys(PWD)

    driver.find_element_by_xpath('//*[@id="lsform"]/div/div/table/tbody/tr[2]/td[3]/button').click()
    # get the cookies created
    cookies = driver.get_cookies()
    time.sleep(3)

def crawlStory(storyURL, f):
    driver.get(storyURL)
    title = driver.find_element_by_id('thread_subject')
    f.write('------------------------------\n')
    f.write(storyURL + '\n')
    f.write(title.text + '\n')
    li = driver.find_element_by_class_name('pcb').find_elements_by_tag_name('li')
    for item in li:
        try:
            if item.find_element_by_tag_name('span'):
                hiddenLinks = item.find_elements_by_tag_name('a')
                for link in hiddenLinks:
                    link.click()
                    time.sleep(0.35)
        except Exception:
            pass

    li = driver.find_element_by_class_name('pcb').find_elements_by_tag_name('li')
    for item in li:
        try:
            f.write(item.text + '\n')
        except Exception:
            pass



def getStoryURL(rootURL):
    for page in range(20):
        r = requests.get(rootURL+str(page+1), headers=example_headers)

        soup = BeautifulSoup(r.text, 'html.parser')

        tbody = soup.find_all('tbody', {'id': re.compile('normalthread_\d+')})

        for item in tbody:
            print(item.find('a', {'class': 's xst'}).get('href'));


